Finally! Here is the last kind of control flow structure that fits into the loops category. The for statement is a control flow structure that allows the programmer to repeatedly execute a block of code not only by a specific number of times but also until some condition evaluates to true. Unlike the while and do-while loops, a for loop is particularly useful in scenarios where the developer knows in advance how many times he/she/they want such loop to iterate. In case you don't remember the structure of a for loop, let's do a simple refresh: A for loop has 4 components, which are: Initialization: This is where you declare and initialize a loop control variable. This happens only once, at the beginning of the loop. In Bleach, the programmer is also allowed to put an expression statement in this place. Condition: This is a logical expression that is evaluated before each iteration of the loop. If the condition evalutes to true, the loop continues. Otherwise, if it evaluates to false, the loop finishes its execution. Increment: This is an expression that updates the loop control variable after each iteration. It usually increments or decrements the loop variable. To be honest, this can be any kind of expression. Not necessarily an expression that updates the loop control variable of the for loop. Code Block: The block of code that will be executed each time the condition is true. It's also important to mention that the first three components might be absent inside the structure of a for loop. In short, this is the expected structure of a for loop in Bleach: for(initialization; condition; increment){ // the code of the block goes here.
} Last, but not least, as the while and do-while loops require, the for loops in Bleach need a block between the keywords after its ) character. In practice, this means that the following code snippet will not even execute: for(let counter = 0; counter < 10; counter = counter + 1) print counter; On the other hand, the following one will execute without any issues: for(let counter = 0; counter < 10; counter = counter + 1){ print counter;
}

