As we all know, inheritance is a fundamental concept in object-oriented programming which allows a class to inherit attributes and methods from another class. The major purpose for the existence of inheritance is to promote code reuse and to establish a natural hierarchy between classes. In Bleach, as in other popular languages such as C++, C#, Java , JavaScript and Python, inheritance allows the programmer to create a new class based on an existing class, extending or modifying its functionality. Going further, Bleach follows a very similar implementation of inheritance to that of Python with just one major difference: For simplicity purposes, Bleach only supports single inheritance whereas Python has support for multiple inheritance (Talking about this, such a thing can be easily added to the Bleach Interpreter and it's a good practice for students to deepen their knowledge). As usual, the code snippet below shows how inheritance, method overriding and the super keyword work in practice: class Animal{ method init(name){ self.name = name; } method speak(){ std::io::print(self.name, "makes a sound."); }
